const getDataFromApi = () => {
  return fetch("https://rickandmortyapi.com/api/character/")
    .then((response) => response.json())
    .then((data) => {
      return data.results;
    });
};

// eslint-disable-next-line import/no-anonymous-default-export
export default {
  getDataFromApi: getDataFromApi,
};
